  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143948 includes discrete
  sample and profile data collected from OCEAN RESEARCHER I in the Philippine Sea
  and South China Sea (Nan Hai) from 1991-07-08 to 1991-07-12. These data include
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, SALINITY, WATER TEMPERATURE, phosphate and
  silicate. The instruments used to collect these data include CTD and bottle.nnThese
  data were collected by Cho-Teng Liu of National Taiwan Ocean University as part
  of the WOCE_PR21b_21OR19910708 data set. CDIAC associated the following cruise ID(s)
  with this data set: 21OR287_2 and WOCE_PR21b_1991nnThe World Ocean Circulation Experiment
  (WOCE) was a major component of the World Climate Research Program with the overall
  goal of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
